import React from 'react';
import {Switch, Route} from 'react-douter-dom';

export default () => {
    return (
        <Switch>    
            <Route path="/">
                Pagina inicial
            </Route>  
            <Route path="/config">
                Pagina conf
            </Route>
        </Switch>
    )
}
